{"update_id": 593756439, "message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "text": "name: Generate and Submit Pull Request\non:\n  push:\n    branches:\n      - main  # Change this to the branch where you want to trigger the action\n\njobs:\n  generate_and_submit_pr:\n    runs-on: ubuntu-latest\n    steps:\n      - name: Checkout Repository\n        uses: actions/checkout@v2\n\n      - name: Set Up Node.js\n        uses: actions/setup-node@v2\n        with:\n          node-version: '14.x'  # Change this to the desired Node.js version\n\n      - name: Install Dependencies\n        run: npm install  # or yarn install\n\n      - name: Run Node.js Script\n        run: node path/to/your/script.js\n\n      - name: Commit Generated File\n        run: |\n          git config --global user.name \"Your GitHub Username\"\n          git config --global user.email \"your-email@example.com\"\n          git add path/to/generated-file  # Replace with the path to your generated file\n          git commit -m \"Add generated file\"\n          git push origin main  # Push the changes to the main branch\n\n      - name: Create Pull Request\n        uses: peter-evans/create-pull-request@v3\n        with:\n          token: ${{ secrets.GITHUB_TOKEN }}\n          commit-message: 'Add generated file'\n          branch: 'new-feature-branch'  # Change this to the name of the branch you want to create\n          title: 'New feature: Generated file'\n          body: 'This pull request adds a new file generated by the GitHub Action.'", "group_chat_created": false, "entities": [{"length": 9, "type": "url", "offset": 677}, {"length": 10, "type": "url", "offset": 740}, {"length": 22, "type": "email", "offset": 752}], "message_id": 144, "delete_chat_photo": false, "date": 1690243390, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nitesh_btc", "first_name": "Nitesh \u20bf\u26a1\ufe0f", "id": 1754038530, "is_premium": true}}}
