{"update_id": 593756454, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "@jordan_bravo and @Tapatingo , could you share your experiences and why you feel this service is valuable? I\u2019m a bit skeptical of the value proposition in light of telegram and nostr. It doesn\u2019t seem worth the privacy compromises with respect to geolocation especially given that there are ways for malicious users to fake their geolocation so not allowing users to put in a country and zip code combo isn\u2019t protecting users from malicious users.  On the other hand, similar compromises are made using Meetup and I wouldn\u2019t know about this wonderful group without Meetup. From this perspective, Orange Pill seems like a more focused version of Meetup.", "group_chat_created": false, "entities": [{"length": 13, "type": "mention", "offset": 0}, {"length": 10, "type": "mention", "offset": 18}], "message_id": 10138, "delete_chat_photo": false, "date": 1690292081, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "ahead9969", "first_name": "Antwane", "last_name": "Mason", "id": 6194622090}}}
