{"update_id": 593756709, "message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "group_chat_created": false, "caption": "the key to this strategy is using nextjs for what its good at: dynamic path / document rendering. notice the [slug] folder. the name of each .md inside /posts will basically fill in that [slug] with the name creating folders for each .md and index.tsx files for each. we just need to figure out how to abstract enough detail to templatize every .md to feed in the data. Then we need to figure out how to adapt our /app project to allow us to do getStaticProps from the /app/page.tsx file.", "message_id": 320, "delete_chat_photo": false, "caption_entities": [{"length": 6, "type": "bot_command", "offset": 152}, {"length": 6, "type": "code", "offset": 187}, {"length": 4, "type": "bot_command", "offset": 414}, {"length": 13, "type": "code", "offset": 469}], "date": 1690557336, "supergroup_chat_created": false, "photo": [{"width": 90, "height": 37, "file_id": "AgACAgEAAx0CY5SDTQACAUBkw9uYdQhUYCDjRc5zdMJZHxt0wAACKqsxG8PZIEb9pmNxhWFTtAEAAwIAA3MAAy8E", "file_size": 812, "file_unique_id": "AQADKqsxG8PZIEZ4"}, {"width": 320, "height": 133, "file_id": "AgACAgEAAx0CY5SDTQACAUBkw9uYdQhUYCDjRc5zdMJZHxt0wAACKqsxG8PZIEb9pmNxhWFTtAEAAwIAA20AAy8E", "file_size": 6129, "file_unique_id": "AQADKqsxG8PZIEZy"}, {"width": 582, "height": 242, "file_id": "AgACAgEAAx0CY5SDTQACAUBkw9uYdQhUYCDjRc5zdMJZHxt0wAACKqsxG8PZIEb9pmNxhWFTtAEAAwIAA3gAAy8E", "file_size": 10319, "file_unique_id": "AQADKqsxG8PZIEZ9"}], "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
