{"update_id": 593757366, "message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "text": "Bitcoiners are scrappy open source freedom loving hackers, so it doesn't make sense to us at first glance. I think Lightspark is trying to sell enterprise software and they know that to sell it to an enterprise audience they need to give it an enterprise price tag, otherwise it may not look like a serious solution. On the other hand, it kind of goes against the narrative that lightning is this cheap, easily accessible alternative to traditional financial technology.", "group_chat_created": false, "message_id": 910, "delete_chat_photo": false, "date": 1691434189, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
