{"update_id": 593757385, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Weird to see so many people crammed into Underground Atlanta", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "https://youtu.be/BimvBrf6-KY", "group_chat_created": false, "entities": [{"length": 28, "type": "url", "offset": 0}], "edit_date": 1691434204, "message_id": 10316, "delete_chat_photo": false, "date": 1691433714, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}, "message_id": 10322, "delete_chat_photo": false, "date": 1691434746, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10316, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
{"update_id": 593757386, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I believe (redeveloped) Underground was either brand new or just a year old \ud83e\udd37\ud83c\udffb\u200d\u2642\ufe0f at that time. They\u2019ve also hosted NYE parties, etc, but the redevelopment has been a spectacular failure, boondoggle, skimming operation.\n\nWe moved to Atlanta in 1968, so my parents would go with other couples to OG Underground which of course had a history and authenticity.\n\nDon\u2019t get me started, \ud83e\udd26\ud83c\udffb\u200d\u2642\ufe0f  but most of Dunwoody was owned by the Spruill family and they grew corn before selling the land for Perimeter Mall, Dunwoody Village, etc.\n\nAs kids we\u2019d ride bikes down Womack to play at the Perimeter Mall job site after construction stopped at like 3pm. Massive red clay dirt clod fights. I believe during the first oil shortage Nixon modified Daylight Savings Time so it was light until almost 10:30pm which was magic for feral kids on bikes \ud83e\udd23\n\nAtlanta has always been a city of progress and I\u2019m happy to see y\u2019all carrying on \ud83d\ude4c\ud83c\udffc\ud83c\udfc6", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Weird to see so many people crammed into Underground Atlanta", "group_chat_created": false, "message_id": 10322, "delete_chat_photo": false, "date": 1691434746, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10316, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}, "message_id": 10323, "delete_chat_photo": false, "date": 1691438446, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10316, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}}
