{"update_id": 593757489, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "It was great seeing everyone last night at Cleanspark! I'm glad to hear everyone enjoyed it. Real credit goes to Craig and the Cleanspark crew, I'm glad they shared their time with us and were open minded to the idea of bringing a huge group of people they had never met into a secure data center.", "group_chat_created": false, "message_id": 10399, "delete_chat_photo": false, "date": 1691676272, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
