{"update_id": 593757660, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "What I do is I got a cheap VPS online and redirect all traffic from VPS to home server via wireguard VPN", "group_chat_created": false, "message_id": 10430, "delete_chat_photo": false, "date": 1692145253, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nitesh_btc", "first_name": "Nitesh \u20bf\u26a1\ufe0f", "id": 1754038530, "is_premium": true}}}
{"update_id": 593757661, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "So I get a static IP and point all my DNS to that IP and redirect traffic to my homeserver. At that point it doesn't matter what ports are blocked.", "group_chat_created": false, "message_id": 10431, "delete_chat_photo": false, "date": 1692145296, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nitesh_btc", "first_name": "Nitesh \u20bf\u26a1\ufe0f", "id": 1754038530, "is_premium": true}}}
