{"update_id": 593757750, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "TLDR, the founder of Pubkey (the place I posted pictures from last month) loves dive bars, so he sometimes does pop-ups in other cities which is just a fancy way of saying they sort of rent out a dive bar and throw an after-party there.\n  \nPubkey is sort of like an homage to dive bars...it's actually a pretty nice place, IMO, but the interior is designed to evoke the feeling of a classic american dive.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "\ud83e\udd14 see, I thought I was showing restraint by neglecting Magic City \ud83e\udd23\ud83d\ude44\ud83e\udd26\ud83c\udffb\u200d\u2642\ufe0f\n\nI should probably read up on this Pubkey Popup thing \ud83e\udd37\ud83c\udffb\u200d\u2642\ufe0f\n\nMaking it Reign, every Monday Night \nhttps://www.magiccity.com/", "group_chat_created": false, "entities": [{"length": 26, "type": "url", "offset": 179}], "message_id": 10472, "delete_chat_photo": false, "date": 1692283218, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10463, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}, "message_id": 10474, "delete_chat_photo": false, "date": 1692287648, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10463, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
