{"update_id": 593757755, "message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "text": "Typically, when people have made donations towards the meetup, I just use it to get drinks and food at the meetups, which are recurring expenses. So the money is spent relatively quickly. If folks desire some kind of more in-depth community funding thing, we can certainly discuss that. But the BitDevs meetups are pretty simple money-wise...get food and drinks for each meetup.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "text": "And about the treasury that is something we can think about. It will be a good exercise to put in practice community funds management etc with Bitcoin. I only hope whoever is the leader of bitdevs treasury does better job than Janet Yellen \ud83d\ude02\ud83d\ude02", "group_chat_created": false, "message_id": 1038, "delete_chat_photo": false, "date": 1692195293, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "aidalop21", "first_name": "Aida", "last_name": "Lop", "id": 5357934973}}, "message_id": 1039, "delete_chat_photo": false, "date": 1692290830, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 1038, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
{"update_id": 593757756, "message": {"chat": {"id": -1001670677325, "type": "supergroup", "title": "BitDevs Upgrade"}, "text": "Ok, so since Aida withdraws herself from the split, then we have a 6 way split. I am going to pass everyone's email along to Kody at Fedi. Kody's money guy is going to email all of us and have us confirm how we want it distributed. Bureaucratic for a bitcoin company, right? Whatever.", "group_chat_created": false, "message_id": 1040, "delete_chat_photo": false, "date": 1692290951, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
{"update_id": 593757757, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "\ud83c\uddf8\ud83c\uddfb\ud83d\udca5\ud83d\udcb0\ud83e\udd11 \u2014 El Salvador President Nayib Bukele scared off many on Wall Street by embracing Bitcoin. Two years later, the bond rally he\u2019s overseeing is proving too lucrative to resist.\n\nEye-popping 70% returns \u2014 the best among dollar bonds from emerging markets this year \u2014 are attracting investors who were once cautious or avoiding the securities altogether. JPMorgan Chase & Co, Eaton Vance and PGIM Fixed Income are among those who have recommended or bought the debt, betting it will continue climbing.\n\n\u201cAlthough we missed a significant share of the rally, we still think there\u2019s value across El Salvador\u2019s curve,\u201d JPMorgan research strategists Ben Ramsey, Nishant Poojary and Gorka Lalaguna wrote in a July note, moving overweight on the debt. \u201cThere\u2019s room for this credit to keep outperforming.\u201d\n\nThe optimism demonstrates how Bukele has gained acceptance from both money managers and his peers in Latin America after many had dismissed him as an anti-establishment maverick. His hard-line stance on gangs, which has dramatically cut crime in the country, is influencing politics throughout the region. And his commitment to paying bondholders is making him a favorite among emerging-market investors.\n\nSource \ud83d\udd17", "group_chat_created": false, "entities": [{"length": 2, "url": "https://www.bloomberg.com/news/articles/2023-08-15/bitcoin-touting-bukele-s-bond-rally-draws-jpmorgan-eaton-vance?cmpid=socialflow-twitter-business&utm_content=business&utm_campaign=socialflow-organic&utm_medium=social&utm_source=twitter", "type": "text_link", "offset": 8}, {"length": 34, "url": "https://t.me/tupireport/13687", "type": "text_link", "offset": 13}, {"length": 60, "type": "bold", "offset": 212}, {"length": 111, "type": "italic", "offset": 509}, {"length": 55, "type": "italic", "offset": 751}, {"length": 30, "url": "https://t.me/tupireport/13917", "type": "text_link", "offset": 985}, {"length": 48, "url": "https://t.me/tupireport/13641", "type": "text_link", "offset": 1016}, {"length": 43, "url": "https://t.me/tupireport/13593", "type": "text_link", "offset": 1068}, {"length": 56, "type": "bold", "offset": 1153}, {"length": 9, "url": "https://www.bloomberg.com/news/articles/2023-08-15/bitcoin-touting-bukele-s-bond-rally-draws-jpmorgan-eaton-vance?cmpid=socialflow-twitter-business&utm_content=business&utm_campaign=socialflow-organic&utm_medium=social&utm_source=twitter", "type": "text_link", "offset": 1212}], "edit_date": 1692453280, "message_id": 10462, "delete_chat_photo": false, "date": 1692226703, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}}
