{"update_id": 593757783, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I'm actually not sure where you are seeing the 3rd edition on GitHub. The most current edition on GitHub is the 2nd edition. There is an mb3dev branch, which is grossly outdated and not maintained.\n  \nhttps://github.com/bitcoinbook/bitcoinbook", "group_chat_created": false, "entities": [{"length": 6, "type": "code", "offset": 137}, {"length": 42, "type": "url", "offset": 201}], "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I am going to start reading Mastering Bitcoin. I see the third edition is on github. Does anyone have an opinion that I should start with 1st or 2nd edition instead for any reason?", "group_chat_created": false, "message_id": 10486, "delete_chat_photo": false, "date": 1692580186, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "YourCryptoDoctor", "first_name": "Rich", "last_name": "Lassiter", "id": 5276929166}}, "message_id": 10499, "delete_chat_photo": false, "date": 1692621242, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10486, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
{"update_id": 593757784, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I was actually just chatting with David Harding the other day about the 3rd edition. (He's the author of the 3rd edition). The 3rd edition of Mastering Bitcoin will be released in print later this year. The open source version will go on GitHub after that.", "group_chat_created": false, "message_id": 10500, "delete_chat_photo": false, "date": 1692621358, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
{"update_id": 593757785, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I'd personally like to wait until the 3rd edition is out before conducting a reading group series on the book, as it will cover taproot, schnorr, and feature segwit as a first-class citizen and not some interesting new concept.\n  \nHaving said that @YourCryptoDoctor, the 2nd edition is still great and if you're itching to explore the technical, I say you should go for it and dive in \ud83e\udd19", "group_chat_created": false, "entities": [{"length": 17, "type": "mention", "offset": 248}], "message_id": 10501, "delete_chat_photo": false, "date": 1692621497, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
