{"update_id": 593757968, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Was scrolling through this chat and saw this. Borrowing against your bitcoin can also be an option. That\u2019s basically the problem the Lava Loans Protocol is solving, helping you borrow against bitcoin safely and easily in self-custody. If you\u2019re LT bullish on bitcoin and think BTC appreciation will be higher than the interest rate you can get on a BTC backed loan, borrowing makes sense. But when you\u2019re borrowing, you want to make sure your BTC collateral won\u2019t get rehypothecated, lost, or confiscated in a loan. using Lava, you can lock BTC in a programmed contract and receive stablecoins (which you can convert to fiat for basically free if you want). The protocol makes loan terms transparent to you, gives you confidence the collateral won\u2019t be lost stolen or confiscated, and doesn\u2019t require you to KYC, sign a bunch of paperwork, and wait many days. There are some risks like using a set of oracles. Lava tries to minimize the risks as much as possible through creating optionality, redundancy, and privacy (you can choose your own oracle, you can choose a large set of oracles, you can make sure oracles don\u2019t even know you\u2019re using their price feeds in a contract, etc). I can speak more to this if you\u2019re interested.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "For those not planning to sell, what\u2019s the plan to extract some buying power from your stack when the time is right?", "group_chat_created": false, "edit_date": 1693190489, "message_id": 10627, "delete_chat_photo": false, "date": 1693150268, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10626, "from": {"is_bot": false, "username": "zmill28", "first_name": "Zach | Xsauce +\u26a1\ufe0f", "id": 2010811248}}, "message_id": 10631, "delete_chat_photo": false, "date": 1693208046, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 10626, "from": {"is_bot": false, "username": "shehzanmaredia", "first_name": "Shehzan", "last_name": "Maredia", "id": 1816308938}}}
